import React from "react";

const WorldTable = (props) => {
  console.log(props.WorldData);
  return (
    <div>
      <h1>World Scores</h1>
      <ul>
        {props.worldData.map((data) => {
          return <li>{data.n}</li>;
        })}
      </ul>
    </div>
  );
};

export default WorldTable;
